export const GetPokemonDetail = ({match}) => {
    const Element = () =>{
        return <h2>{match.params.type}</h2>
    }
    return (
        <>
        {match ? <Element/> : null}
        </>
    )
}
export const PokemonDetail = () => {
    return(
        <>
        <h1>Pokemon Detail</h1>
        <GetPokemonDetail/>
        </>
    )
};
